    <script src="https://unpkg.com/@babel/standalone/babel.min.js"></script>
    <script type="text/babel">
        function Gallery({ children }) {
            return (
                <div style={{ display: 'grid', gridTemplateColumns: 'repeat(3, 1fr)', display: "flex", display: "column", justifyContent: "space-aroun", marginLeft: "30px" }}>
                    {children}
                </div>
            );
        }

        function Image({ src }) {
            return <img src={src} alt="gallery" style={{ width: "200px", height: "200px", borderRadius: "10px", margin: "10px", marginLeft: "10px" }} />;
        }
